import React, {useEffect} from 'react'
import usePages from '../data/usePages'

import { useParams } from "react-router-dom"

var pageNotNull = [];
const Home = (props) => {
    let {location} = useParams();
    
    useEffect( () => {
        ga('send', 'pageview');
    }, [location])
    return (
        <div>Home</div>
    )
}

export default Home
